import React from "react";

const PorfolioProject = props => {
  return (
    <div className="row">
      {props.myPorftolioUn.map(myFolio => (
        <a
          href="https://openclassrooms.com/forum/sujet/faire-d-une-div-un-lien"
          className="text-decoration-none text-dark"
        >
          <div
            className="card"
            style={{
              width: "28rem",
              marginTop: "20px",
              marginRight: "30px",
              padding: 0
            }}
            key={myFolio.id}
          >
            <img src={myFolio.myImg} className="card-img-top" alt="..." />
            <div className="card-body">
              <h5 className="card-title fw-bolder text-lowercase">
                {" "}
                {myFolio.mytitle}{" "}
              </h5>
              <p className="card-text">{myFolio.myContent}</p>
            </div>
          </div>
        </a>
      ))}
    </div>
  );
};

export default PorfolioProject;
